import logo from './logo.svg';
import './App.css';

const htmlContent = `
<!DOCTYPE html>
<html lang="en">

<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Домашняя страница</title>
    <style>
        body {
            font-family: Arial, sans-serif;
            margin: 0;
            padding: 0;
            box-sizing: border-box;
        }

        .App {
            text-align: center;
            padding: 20px;
        }

        .App-header {
            background-color: #282c34;
            min-height: 100vh;
            display: flex;
            flex-direction: column;
            align-items: center;
            justify-content: center;
            font-size: calc(10px + 2vmin);
            color: white;
        }

        .App-logo {
            height: 40vmin;
            pointer-events: none;
        }

        code {
            font-size: 1.5em;
        }
    </style>
</head>

<body>
    <div class="App">
        <header class="App-header">
            <img src="path/to/your/logo.png" class="App-logo" alt="logo" />
            <p>
                <code>Geometry</code>
            </p>
            <p>Welcome to the Home Page!</p>
        </header>
    </div>
</body>

</html>
`;

function App() {
  return (
    <div dangerouslySetInnerHTML={{ __html: htmlContent }} />
  );
}

export default App;
